package com.bucketlist.controller;

import com.bucketlist.model.Entry;
import com.bucketlist.service.EntryService;
import javassist.tools.rmi.Sample;
import lombok.Data;
import lombok.NoArgsConstructor;
import lombok.NonNull;
import lombok.RequiredArgsConstructor;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.http.HttpStatus;
import org.springframework.web.bind.annotation.*;

import javax.persistence.Entity;
import javax.persistence.GeneratedValue;
import javax.persistence.GenerationType;
import javax.persistence.Id;
import java.util.ArrayList;
import java.util.List;
import java.util.Map;
import java.util.HashMap;

@RestController
@RequestMapping("/ester")
public class EntryController {

    @Autowired
    private EntryService entryService;

    @RequestMapping(method = RequestMethod.GET)
    public List<Entry> getAllEntries() {
        return entryService.getAllEntries();
    }

    @RequestMapping(method = RequestMethod.PUT)
    public Entry createEntry(@RequestParam(value = "title", required = true) String title,
                             @RequestParam(value = "content", required = true) String content) {
        return entryService.createEntry(title, content, false);
    }

    @RequestMapping(value = "/{id}/select", method = RequestMethod.POST)
    public Entry selectEntry(@PathVariable Long id) {
        Entry entryToSelect = entryService.findById(id);
        entryToSelect.setSelected(!entryToSelect.getSelected());
        return entryService.editEntry(entryToSelect);
    }

    @RequestMapping(value = "/{id}/edit", method = RequestMethod.POST)
    public Entry editEntry(@PathVariable Long id,
                           @RequestParam(value = "title", required = true) String title,
                           @RequestParam(value = "content", required = true) String content) {
        Entry entryToEdit = entryService.findById(id);
        entryToEdit.setTitle(title);
        entryToEdit.setContent(content);
        return entryService.editEntry(entryToEdit);
    }

    @RequestMapping(value = "/{id}", method = RequestMethod.DELETE)
    @ResponseStatus(value = HttpStatus.OK)
    public void deleteEntry(@PathVariable Long id) {
        entryService.deleteEntry(id);
    }

    @RequestMapping(value = "/data/getImageByIsbn", method = RequestMethod.GET)
    public Map<String, String> getBook(@RequestParam(value = "isbnCode", required = true) String isbnCode) {
        Map<String, String> sampleBook = new HashMap<>();
        sampleBook.put("isbnCode", isbnCode);
        sampleBook.put("imageData", "");
        return sampleBook;
    }

    @RequestMapping(value = "/data/getSampleData", method = RequestMethod.POST)
    public List<SampleData> getSampleData(@RequestBody String[] isbnValues) {
        List<SampleData> sampleResponse = new ArrayList<>();
        boolean trigger = false;
        for (String isbnValue : isbnValues) {
            SampleData sampleData;
            if (trigger)
                sampleData = new SampleData(isbnValue, "The Adventures of Tom Sawyer", "Mark Twain", "United States", "English, Limited Edition (Spanish)", "Bildungsroman, picaresque novel, satire, folk, children's literature", "American Publishing Company", "1876", "");
            else
                sampleData = new SampleData(isbnValue, "Adventures of Huckleberry Finn", "Mark Twain", "United States", "English", "Picaresque novel", "Chatto & Windus / Charles L. Webster And Company.", "December 10, 1884 (UK & Canada)", "");
            trigger = !trigger;
            sampleResponse.add(sampleData);
        }
        return sampleResponse;
    }

    @Data
    @RequiredArgsConstructor
    @NoArgsConstructor
    class SampleData {
        @NonNull
        private String code;
        @NonNull
        private String title;
        @NonNull
        private String author;
        @NonNull
        private String country;
        @NonNull
        private String language;
        @NonNull
        private String genre;
        @NonNull
        private String publisher;
        @NonNull
        private String date;
        @NonNull
        private String imageData;
    }
}
